import React from "react";

import PolicyholderCell from "./PolicyholderCell/index";

const PolicyholdersList = ({policyholderList, addFavourite, onPolicyholderSelect, onSavePolicyholder, onDeletePolicyholder}) => {
  return (
    <div className="gx-contact-main-content">
      {policyholderList.map((policyholder, index) =>
        <PolicyholderCell key={index} policyholder={policyholder} onDeletePolicyholder={onDeletePolicyholder}
                     onSavePolicyholder={onSavePolicyholder}
                     addFavourite={addFavourite} onPolicyholderSelect={onPolicyholderSelect}/>
      )}

    </div>
  )
};

export default PolicyholdersList;
